// src/router/index.js
import { createRouter, createWebHistory } from 'vue-router'
import Home from '../views/Home.vue'
import DataAnalysis from '../views/DataAnalysis.vue'
import PredictionAnalysis from '../views/PredictionAnalysis.vue'
import KnowledgeMap from '../views/KnowledgeMap.vue'
import DataStatistics from '../views/DataStatistics.vue'
import DataScrapy from '../views/DataScrapy.vue'

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home
  },
  {
    path: '/analysis',
    name: 'DataAnalysis',
    component: DataAnalysis
  },
  {
    path: '/prediction',
    name: 'PredictionAnalysis',
    component: PredictionAnalysis
  },
  {
    path: '/knowledgeMap',
    name: 'KnowledgeMap',
    component: KnowledgeMap
  },
  {
    path: '/statistics',
    name: 'DataStatistics',
    component: DataStatistics
  },
  {
    path: '/scrapy',
    name: 'DataScrapy',
    component: DataScrapy
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
